tables.table_schema:
CREATE TABLE quantum_training_data (
    id SERIAL PRIMARY KEY,
    training_date TIMESTAMP NOT NULL,
    model_name VARCHAR(50) NOT NULL,
    training_data JSONB NOT NULL
);

CREATE TABLE evaluation_results (
    id SERIAL PRIMARY KEY,
    evaluation_date TIMESTAMP NOT NULL,
    model_name VARCHAR(50) NOT NULL,
    evaluation_score NUMERIC NOT NULL
);

CREATE TABLE training_data (
    training_id SERIAL PRIMARY KEY,
    data_date DATE,
    data_input FLOAT,
    data_output FLOAT
);

CREATE TABLE model_parameters (
    model_id SERIAL PRIMARY KEY,
    model_name VARCHAR(50),
    model_version INT,
    model_description TEXT
);

CREATE TABLE evaluation_results (
    evaluation_id SERIAL PRIMARY KEY,
    model_id INT,
    evaluation_date DATE,
    evaluation_metric FLOAT
);

CREATE TABLE quantum_machine_learning_data (
    id INT PRIMARY KEY,
    date TIMESTAMP,
    model_name VARCHAR(255),
    training_data TEXT
);

CREATE TABLE quantum_retraining_logs (
    log_id INT PRIMARY KEY,
    retrain_date TIMESTAMP,
    model_id INT,
    retraining_notes TEXT
);

CREATE TABLE quantum_models (
    model_id INT PRIMARY KEY,
    model_name VARCHAR(255),
    description TEXT
);
